import React, {useState} from 'react';
import ListImageGif from './components/ListImageGif';
import './App.css';



function App() {

  const [value, setValue] = useState("Star Wars");

  return (
    <div className="App">
      <input onChange={(e) => setValue(e.target.value)} className='form-control' placeholder='Star' />
      <ListImageGif search={value} />
    </div>
  );
}

export default App;
